import { Link, NavLink } from "react-router-dom"
import './Navbar.scss'

const links = ["Lisos", "Estampados", "Tricolor", "Premium"];

export const Navbar = () => {
    return <header className="header">
        <div> <a href="../index.js"> <img src="././img/logo.png" alt="Logo Denver" /> </a> </div>
        <div className="header__nav">
            {links.map(({ label, to }) => {
                return <Link to={to} key ={elemento}>
                    {elemento}
                </Link>;
            })}
        </div>
        <CartWidget />
    </header>
}
